func FindAdverseEventContributingFactor(filter string) []AdverseEventContributingFactor {
	ret := make([]AdverseEventContributingFactor, 0)
	for _, at := range AllAdverseEventContributingFactor() {
		if strings.ToLower(at.String())[0:len(filter)] == strings.ToLower(filter) {
			ret = append(ret, at)
		}
	}
	return ret
}

